import React from 'react';

const User = ({ username, id, password, created_at }) => {
  return (
    <ul>
      <li>{username}</li>
      <li>{id}</li>
      <li>{password}</li>
      <li>{created_at}</li>
    </ul>
  )
}

export default User;
